import React from 'react'

function Home() {
  return (
   <>
    <div className='container'>
        <div className='row'>
            <div className='col'>
                <h1>Home</h1>
            </div>
            <div className='col'></div>
        </div>
    </div>
   </>
  )
}

export default Home;
